    public int minDominoRotations(int[] A, int[] B) {
        int len = A.length;
        int routA = 0;//需要旋转A
        int routB = 0;//需要旋转B
        int i = 0;
        for (i = 0; i < len; i++) {
            if (A[i] != A[0] && B[i] != A[0]) {
                break;
            } else if (A[i] != A[0]) {//旋转B
                routB++;
            } else if (B[i] != A[0]) {//旋转A
                routA++;
            }
        }
        int res = -1;
        if (i == len) {
            res = Math.min(routA, routB);
        }
        routA = 0;//需要旋转A
        routB = 0;//需要旋转B
        for (i = 0; i < len; i++) {
            if (A[i] != B[0] && B[i] != B[0]) {
                break;
            } else if (A[i] != B[0]) {//旋转B
                routB++;
            } else if (B[i] != B[0]) {//旋转A
                routA++;
            }
        }
        if (i == len) {
            int resB=Math.min(routA,routB);
            if (res == -1) {
                res = resB;
            } else {
                res = Math.min(res, resB);
            }
        }
        return res;
    }
